DROP TABLE IF EXISTS `house`;
CREATE TABLE `house` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `bh` varchar(16) NOT NULL COMMENT '编号 省2 市2 县2 街道3 村2 流水号5',
  `xzjd` varchar(45) DEFAULT NULL COMMENT '乡镇街道',
  `ssc` varchar(45) NOT NULL COMMENT '所属村',
  `mph` varchar(45) DEFAULT NULL COMMENT '门牌号',
  `jznd` varchar(50) NOT NULL COMMENT '建造年代',
  `zflb` varchar(45) DEFAULT NULL COMMENT '住房类别',
  `cs` varchar(10) NOT NULL COMMENT '房屋层数',
  `jzmj` double NOT NULL COMMENT '建筑面积',
  `js` int(11) NOT NULL COMMENT '间数',
  `zdmj` double NOT NULL COMMENT '占地面子',
  `zfsyqk` varchar(45) DEFAULT NULL COMMENT '住房使用情况',
  `jglx` varchar(45) DEFAULT NULL COMMENT '结构类型',
  `tdxz` varchar(45) DEFAULT NULL COMMENT '土地性质',
  `fcz` varchar(11) DEFAULT NULL COMMENT '房产证',
  `x` double(20,12) NOT NULL COMMENT '经度',
  `y` double(20,12) NOT NULL COMMENT '纬度',
  `zt` int(1) DEFAULT NULL COMMENT '0-待定 1-已鉴定 2-已处置',
  `photos` longtext COMMENT '文件的路径，以英文分号 ;  分隔',
  PRIMARY KEY (`id`),
  UNIQUE KEY `ID_UNIQUE` (`id`) USING BTREE,
  UNIQUE KEY `编号_UNIQUE` (`bh`) USING BTREE
